import car from "./car.jpg";

function CarInfo({ carDetails }) {
  return carDetails ? (
    <div>
      <h1>About this car</h1>
      <p class="text-center">{carDetails.registration}</p>
      <p class="text-center">{carDetails.make}</p>
      <p class="text-center">{carDetails.model}</p>
      <p class="text-center">{carDetails.primaryColour}</p>
      <p class="text-center">{carDetails.motTests[0].expiryDate}</p>
      <p>{carDetails.motTests[0].odometerValue}</p>
    </div>
  ) : (
    <div>
      <p class="text-center">Please insert a valid registration number.</p>
      <img
        src={car}
        alt="car"
        class="h-24 md:h-64 w-full object-cover rounded-xl flex flex-col justify-center items-center"
      />
    </div>
  );
}

export default CarInfo;
